The goal of Salsa is to support efficient incremental recomputation . Salsa is used in rust-analyzer, for example, to help it recompile your program quickly as you type. The basic idea of a Salsa program is like this: let mut input = ...;
loop { let output = your_program(&input); modify(&mut input);
} You start out with an input that has some value. You invoke your program to get back a result. Some time later, you modify the input and invoke your program again. Our goal is to make this second call faster by re-using some of the results from the first call. In reality, of course, you can have many inputs and "your program" may be many different methods and functions defined on those inputs. But this picture still conveys a few important concepts: Salsa separates out the "incremental computation" (the function your_program) from some outer loop that is defining the inputs. Salsa gives you the tools to define your_program. Salsa assumes that your_program is a purely deterministic function of its inputs, or else this whole setup makes no sense. The mutation of inputs always happens outside of your_program, as part of this master loop.

