⚠️ IN-PROGRESS VERSION OF SALSA. ⚠️ This page describes the unreleased "Salsa 2022" version, which is a major departure from older versions of salsa. The code here works but is only available on github and from the salsa-2022 crate. Salsa inputs work best if you can easily provide all of the inputs upfront. However sometimes the set of inputs is not known beforehand. A typical example is reading files from disk. While it is possible to eagerly scan a particular directory and create an in-memory file tree as salsa input structs, a more straight-forward approach is to read the files lazily. That is, when a query requests the text of a file for the first time: Read the file from disk and cache it. Setup a file-system watcher for this path. Update the cached file when the watcher sends a change notification. This is possible to achieve in salsa, by caching the inputs in your database structs and adding a method to the database trait to retrieve them out of this cache. A complete, runnable file-watching example can be found in the lazy-input example . The setup looks roughly like this: #[salsa::input]
struct File { path: PathBuf, #[return_ref] contents: String,
} trait Db: salsa::DbWithJar<Jar> { fn input(&self, path: PathBuf) -> Result<File>;
} #[salsa::db(Jar)]
