The last thing to dicsuss is how the database is initialized. The Default implementation for Storage<DB> does the work: impl<DB> Default for Storage<DB>
where DB: HasJars,
{ fn default() -> Self { let mut routes = Routes::new(); let jars = DB::create_jars(&mut routes); Self { shared: Arc::new(Shared { jars, cvar: Default::default(), }), routes: Arc::new(routes), runtime: Runtime::default(), } }
} First, it creates an empty Routes instance. Then it invokes the DB::create_jars method. The implementation of this method is defined by the #[salsa::db] macro; it simply invokes the Jar::create_jar method on each of the jars: fn create_jars(routes: &mut salsa::routes::Routes<Self>) -> Self::Jars { ( #( <#jar_paths as salsa::jar::Jar>::create_jar(routes), )* ) } This implementation for create_jar is geneated by the #[salsa::jar] macro, and simply walks over the representative type for each salsa item and asks it to create its ingredients quote! { impl<'salsa_db> salsa::jar::Jar<'salsa_db> for #jar_struct { type DynDb = dyn #jar_trait + 'salsa_db; fn create_jar<DB>(routes: &mut salsa::routes::Routes<DB>) -> Self where DB: salsa::storage::JarFromJars<Self> + salsa::storage::DbWithJar<Self>, { #( let #field_var_names = <#field_tys as salsa::storage::IngredientsFor>::create_ingredients(routes); )* Self(#(#field_var_names),*) } } } The code to create the ingredients for any particular item is generated by their associated macros (e.g., #[salsa::tracked], #[salsa::input]), but it always follows a particular structure. To create an ingredient, we first invoke Routes::push, which creates the routes to that ingredient and assigns it an IngredientIndex. We can then invoke a function such as FunctionIngredient::new to create the structure. The routes to an ingredient are defined as closures that, given the DB::Jars, can find the data for a particular ingredient.

