A salsa database struct is declared by the user with the #[salsa::db] annotation. It contains all the data that the program needs to execute: #[salsa::db(jar0...jarn)]
struct MyDatabase { storage: Storage<Self>, maybe_other_fields: u32,
} This data is divided into two categories: Salsa-governed storage, contained in the Storage<Self> field. This data is mandatory. Other fields (like maybe_other_fields) defined by the user. This can be anything. This allows for you to give access to special resources or whatever.
